description:
The DP1 Deltic for Train Simulator is available in its distinctive blue demonstrator/testing livery, featuring two-tone horn and cab lighting, plus BR Mk1 maroon coaches as used on modern day rail tours, complete with passenger view. 

The locomotive is also Quick Drive compatible, giving you the freedom to drive the BR DP1 Deltic on any Quick Drive enabled route for Train Simulator. Also included are scenarios specifically for the Settle-Carlisle route (available separately and required to play these scenarios).



Please support the developers and buy some of their content if you can afford it.


Please use the email address for requests and questions and if you want to share an addon with the community then contact us and we will post it on your behalf. If you would like to contribute, please read the Readme.pdf.


